import React from 'react'
import Navbar from "./components/Navbar/Navbar";
import './App.css';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import { StreamApp, NotificationDropdown, FlatFeed } from 'react-activity-feed';
import Aspirantes from './components/Aspirantes/Aspirantes';
import Estudiantes from './components/Estudiantes/Estudiantes';
import Profesores from './components/Profesores/Profesores';
import Inicio from './components/Inicio/Inicio'
import 'react-activity-feed/dist/index.css';

function App() {

  return (
    <Router>
      <div className="App">
        <Navbar/>
        <Switch>
            <Route exact path={"/Aspirantes"} component={Aspirantes}/>
            <Route exact path={"/Estudiantes"} component={Estudiantes}/>
            <Route exact path={"/Profesores"} component={Profesores}/>
            <Route exact path={"/Inicio"} component={App}/>
        </Switch>
        <StreamApp
            apiKey="du8he7epvp94"
            appId="45206"
            token="eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiOTg5NTRhMTYtNTJlMi00NGZiLTg5MjEtYTQwMGEzMjE4MDc2In0.b-vjdeTb8Dp4WXSSWU1lBlgnvPJoIBx2RRo6bNOC1QM"
        >
          <FlatFeed notify/>
        </StreamApp>
      </div>
    </Router>
  );
}

export default App;
